organization:
{'description': "UNESCO is the UN specialized agency responsible for coordinating international cooperation in education, science, culture and communication. It strengthens the ties between nations and societies, and mobilizes the wider public so that each child and citizen: 
- has access to quality education; a basic human right and an indispensable prerequisite for sustainable development;
- may grow and live in a cultural environment rich in diversity and dialogue, where heritage serves as a bridge between generations and peoples;
- can fully benefit from scientific advances;
- and can enjoy full freedom of expression; the basis of democracy, development and human dignity.
